import React, {useEffect, useState} from 'react';
import {todosLosProductos} from '../funciones/funciones';
import { DataGrid, GridRowsProp, GridColDef } from '@mui/x-data-grid';

function Chart () {
    const [products, setProducts] = useState();
    useEffect(() => {

        fetch("http://localhost:3001/api/products/")
        .then(resultado => resultado.json())
        .then(dataProduct => {
            console.log(dataProduct)
            setProducts(dataProduct.meta.count)
        })
}, [])       

const rows: GridRowsProp = [
    { id: 1, col1: 'Hello', col2: 'World' },
    { id: 2, col1: 'DataGridPro', col2: 'is Awesome' },
    { id: 3, col1: 'Material-UI', col2: 'is Amazing' },
  ]; 
  const columns: GridColDef[] = [
    { field: 'col1', headerName: 'ID ', width: 150 },
    { field: 'col2', headerName: 'Nombre', width: 150 },
    { field: 'col3', headerName: 'Precio', width: 150 },
    { field: 'col4', headerName: 'Descripción', width: 150 },
  ];




    return (
        /* <!-- DataTales Example --> */
        <div style={{ height: 300, width: '100%' }}>
            <DataGrid rows={rows} columns={columns}/>            
        </div>
    )
}

export default Chart;
